import React from "react";
import "./LoginPage.css";

const LoginPage = () => {
  return (
    <div className="login-page">
      {/* Placeholder for Orange Triangle */}
      <div className="orange-triangle-placeholder"></div>

      {/* Placeholder for Pink Circle */}
      <div className="pink-circle-placeholder"></div>

      {/* Login Form */}
      <div className="login-container">
        <div className="profile">
          <img
            src="https://via.placeholder.com/40" // Replace with user's avatar or placeholder
            alt="Profile"
            className="profile-img"
          />
          <div className="profile-icon">G</div>
        </div>
        <form>
          <label>Email</label>
          <input type="email" placeholder="Enter your email" />

          <label>Password</label>
          <input type="password" placeholder="********" />

          <button type="submit" className="btn login-btn">Log In</button>

          <div className="or">OR</div>

          <button type="button" className="btn google-btn">
            <img src="https://upload.wikimedia.org/wikipedia/commons/5/53/Google_%22G%22_Logo.svg" alt="Google" />
            Sign In with Google
          </button>
        </form>
        <div className="register">
          Donâ€™t have an account? <a href="/register">Register now</a>
        </div>
      </div>
    </div>
  );
};

export default LoginPage;
